import React, { useEffect, useState } from 'react';
import '../style/Faq.scss';
import { connect } from 'react-redux';
import { fetchFaq } from '../action';
import CommonCotainer from './CommonContainer';

const Faq = (props) => {

    const [faq, setFaq] = useState(props.faq["Our Food"]);


    useEffect(() => {
        props.fetchFaq();
    }, []);

    console.log(props.faq[`${faq}`], "faq");

    return (
        <div>
            <CommonCotainer heading={"Frequently Asked"} span={"Questions"} />

            <div className="faq-container">
                <div className="faq-buttons">
                    <button>Our Food</button>
                    <button>Our Delivery</button>
                    <button>Our Company</button>
                </div>
                <div className="faq-items">
                    {
                        props.faq.map((faq) => (
                            <div className="faq">
                                <div>
                                    {faq}
                                </div>
                                <div>
                                    hii
                                </div>
                            </div>
                        ))

                    }
                </div>
            </div>
        </div>
    );
};

const mapStateToProps = (state) => {
    return { faq: state.faq };
}

export default connect(mapStateToProps, { fetchFaq })(Faq);
